INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/MacBook-Tasche/CSL - Notebooktasche.webp;', 'CSL - Notebooktasche', 'https://www.amazon.de/Notebooktasche-Schultertasche-Zubeh%C3%B6r-F%C3%A4chern-widerstandsf%C3%A4higen-wasserabweisend/dp/B01MYX4RUP/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2O3ANO6XM110I&keywords=CSL+-+Notebooktasche&qid=1667234965&sprefix=%2Caps%2C65&sr=8-3', '24,99', 4.7, 855, 1, '-;-;Modellbezeichnung: CSL - Aplic Notebook-Tasche | geeignet für Notebooks bis 43,9cm (17,3“) | Hinweis: Der abgebildete Tablet-PC in der Notebook-Tasche dient lediglich Illustrationszwecken und ist nicht Teil des Lieferumfangs.| 302038|universell einsetzbar wie z.B. in öffentlichen Verkehrsmitteln (Bus, Bahn, Taxi, Flugzeug etc.) oder zum Gebrauch für die Schule, an der Universität oder Arbeit|Features: gepolsterter Tragegriffe mit abnehmbaren und gepolsterten Schulterriemen | integrierte Separat-Zusatzfächer (innen und außen) für beispielsweise externe Festplatten, Kabel, Adapter, Netzteile, Mobiltelefone, MP3-Player oder Stifte und anderer Bürobedarf | mit verstellbarem Befestigungsriemen für eine sichere Fixierung und Zubehör-Fächern | widerstandsfähige Polsterwände | komfortable Tragegriffe|Kompatibel mit vielen Notebooks und Laptops bis zu 17" (43,2cm), inkl. der Notebooks von Sony, Panasonic, Acer, Asus, Apple, Lenovo, MSI, Packard Bell, Toshiba, HP, Fujitsu, Dell, Compaq, Gigabyte und Medion. Bitte vor dem Kauf die Abmessungen Ihres Notebooks mit den Innenmaßen der Tasche vergleichen!|Abmessungen (Breite x Höhe x Tiefe): Außenmaße ca. 46 cm x 33 cm x 7,5 cm | Innenmaße ca. 44 cm x 29,5 cm x 6 cm / Das Notebook vor dem Kauf der Tasche bitte auf diese Maße hin prüfen! | Gewicht: 560g (nur Tasche) | Farbe: grau/blau | Material: Polyester | Lieferumfang: Aplic Notebook-Tasche + Längenverstellbarer Schultergurt + Zusatzfächer (3x Außen/3x Innen)');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/MacBook-Tasche/Inateck 360°-Rundumschutz-Laptoptasche 14 Zoll.webp;', 'Inateck 360°-Rundumschutz-Laptoptasche 14 Zoll', 'https://www.amazon.de/Inateck-Rundumschutz-Laptoptasche-Kompatibel-2012-2017%EF%BC%8C13-5/dp/B097H2SHJY/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1L3QIT6GKWQAS&keywords=Inateck+360%C2%B0-Rundumschutz-Laptoptasche+14+Zoll&qid=1667234971&sprefix=inateck+360+-ru%2Caps%2C142&sr=8-4', '18,99', 4.8, 841, 3, '-;-;Breite Kompatibilität: Innenmaße: 32,50 cm * 22,70 cm, Außenmaße: 36,00 cm * 26,00 cm. Die Laptoptasche ist mit 14 Zoll MacBook Pro M1 2021/13-13.3 Zoll Laptops wie 13 Zoll MacBook Pro 2012-2015 (A1425/A1502), 13 Zoll MacBook Air 2012-2017 (A1369/A1466), 13,5 Surface Laptop4/3, MateBook D14|Multifunktionaler Organizer: Auf der Vorderseite befindet sich ein großes Zubehörfach mit zwei Reißverschlüssen, das über zwei Schlitztaschen und Stiftfächer verfügt. Hier können Gegenstände wie Stifte, Karten, USB-Kabel, Ladegeräte usw. untergebracht werden. Auf der Rückseite befindet sich ein weiteres Reißverschlussfach, das zusätzlichen Stauraum bietet.|360° Schutz: Das weiche Flanell-Innenfutter verhindert Reibung. Ein Schutzstreifen entlang des Reißverschlusses schützt Ihren Computer vor Kratzern. Zusammen mit den Schutzstreifen an den Seiten bietet die Hülle Ihrem Laptop einen 360°-Schutz und schützt Ecken effektiv.|Leicht zu transportieren: Der Griff ist robust und langlebig, hat eine weiche Oberfläche und erleichtert das Tragen erheblich. Auf der Rückseite ist ein Gepäckgurt angebracht, mit dem die Hülle an einem Rollkoffer befestigt werden kann, um die Hände auf Reisen frei zu haben.|Klassisches Design: Inateck hat schon immer ein minimalistisches Designkonzept verfolgt, und diese Laptoptasche ist da keine Ausnahme. Klassischer grauer Look im eleganten Stil. Ihr unverzichtbarer Begleiter für Pendeln, Studium und Business!');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/MacBook-Tasche/Inateck Superstarke Laptophülle.webp;', 'Inateck Superstarke Laptophülle', 'https://www.amazon.de/Inateck-Superstarke-Laptoph%C3%BClle-Kompatibel-2012-2017/dp/B09PFLZLZ4/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=27E3Y8DLDVE5E&keywords=inateck+superstarke+laptop+h%C3%BClle&qid=1667234979&sprefix=inateck+superst%2Caps%2C143&sr=8-3', '29,99', 4.7, 823, 0, '-;-;Breite Kompatibilität: Innenmaße 32.5 x 23 x 2 cm ist diese Laptoptasche weitgehend kompatibel mit 14 Zoll MacBook Pro M1 2021, 13-13.3 Zoll Laptops wie 13 Zoll MacBook Pro 2012-2015 (A1425/A1502), 13 Zoll MacBook Air 2012-2017 (A1369/A1466), 14,4 Surface Laptop Studio/13,5 Surface Laptop4/3, Notebook Sleeve Schutzhülle Case.|Durchdachte Details: Langlebige Premium-Doppelreißverschlüsse an der Hauptöffnung für geschmeidiges Öffnen. In der kleinen Zubehörtasche finden Maus, Ladegeräte oder Kopfhörer Platz. Ein elastisches Tuch im Inneren hält Ihren Laptop vom Wackeln ab.|Dreischichtiger Schutz: Die LB01007-13 besitzt eine EVA-Hartschale in der Mitte, um Druck zu widerstehen. Elastisches Innenfutter mit reduziert Stöße und schützt vor versehentlichen Kratzer. Die spritzwassergeschützte Polyesteroberfläche wehrt Spritzwasser ab.|Klassisches Design: Inateck hat schon immer ein minimalistisches Designkonzept verfolgt, und diese Laptoptasche LB01007-13 ist keine Ausnahme. Einfache geometrische Linien ergänzen die graue Farbe, einfach und doch elegant im Stil. Ein großartiger Begleiter für Pendler, Universität, Büro und Geschäftsreisen.|Leicht zu transportieren: Wenn Sie diese Laptoptasche in der Hand halten, haben Sie mehr Halt als bei einer gewöhnlichen EVA-Tasche mit glatter Oberfläche. Dementsprechend rutscht diese Laptoptasche nicht so leicht von Ihren Händen ab.');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/MacBook-Tasche/Case Logic Advantage.webp;', 'Case Logic Advantage', 'https://www.amazon.de/Case-Logic-Laptoptasche-Einschubtasche-Kleinger%C3%A4te/dp/B07L4HQMZ4/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2KK4XY4HQMKI0&keywords=Case+Logic+Advantage&qid=1667234984&qu=eyJxc2MiOiIwLjg2IiwicXNhIjoiMC44NiIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C85&sr=8-1', '29,99', 5.0, 2, 2, 'black;Case Logic;Schlanke, kompakte Tasche mit gepolstertem Innenfach für einen Laptop von bis zu 15,6 Zoll|Spezielle Einschubtasche für ein 10,1-Zoll-Tablet|Geräumiges Vorderfach mit Organizer-System für Stifte und Kleinelektronik sowie reichlich Platz für unhandliche Netzkabel|Vorderfach mit verstecktem Reißverschluss für eine sichere und komfortable Aufbewahrung des Telefons|Der abnehmbare, gepolsterte Schultergurt lässt sich individuell einstellen');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/MacBook-Tasche/Inateck 360°-Rundumschutz-Laptoptasche.webp;', 'Inateck 360°-Rundumschutz-Laptoptasche', 'https://www.amazon.de/Inateck-Rundumschutz-Laptoptasche-Kompatibel-2012-2017%EF%BC%8C13-5/dp/B097H2SHJY/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3266SGTZ5EAPH&keywords=Inateck+360%C2%B0-Rundumschutz-Laptoptasche&qid=1667234991&sprefix=inateck+360+-%2Caps%2C143&sr=8-3', '18,99', 4.8, 841, 0, '-;-;Breite Kompatibilität: Innenmaße: 32,50 cm * 22,70 cm, Außenmaße: 36,00 cm * 26,00 cm. Die Laptoptasche ist mit 14 Zoll MacBook Pro M1 2021/13-13.3 Zoll Laptops wie 13 Zoll MacBook Pro 2012-2015 (A1425/A1502), 13 Zoll MacBook Air 2012-2017 (A1369/A1466), 13,5 Surface Laptop4/3, MateBook D14|Multifunktionaler Organizer: Auf der Vorderseite befindet sich ein großes Zubehörfach mit zwei Reißverschlüssen, das über zwei Schlitztaschen und Stiftfächer verfügt. Hier können Gegenstände wie Stifte, Karten, USB-Kabel, Ladegeräte usw. untergebracht werden. Auf der Rückseite befindet sich ein weiteres Reißverschlussfach, das zusätzlichen Stauraum bietet.|360° Schutz: Das weiche Flanell-Innenfutter verhindert Reibung. Ein Schutzstreifen entlang des Reißverschlusses schützt Ihren Computer vor Kratzern. Zusammen mit den Schutzstreifen an den Seiten bietet die Hülle Ihrem Laptop einen 360°-Schutz und schützt Ecken effektiv.|Leicht zu transportieren: Der Griff ist robust und langlebig, hat eine weiche Oberfläche und erleichtert das Tragen erheblich. Auf der Rückseite ist ein Gepäckgurt angebracht, mit dem die Hülle an einem Rollkoffer befestigt werden kann, um die Hände auf Reisen frei zu haben.|Klassisches Design: Inateck hat schon immer ein minimalistisches Designkonzept verfolgt, und diese Laptoptasche ist da keine Ausnahme. Klassischer grauer Look im eleganten Stil. Ihr unverzichtbarer Begleiter für Pendeln, Studium und Business!');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/MacBook-Tasche/FINPAC 13-14 Zoll Laptop Tasche.webp;', 'FINPAC 13-14 Zoll Laptop Tasche', 'https://www.amazon.de/Fintie-Aktentasche-Hartschalen-Umh%C3%A4ngetasche-Zubeh%C3%B6rtasche/dp/B08Z7PHLZH/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1V9NYQ0772XDX&keywords=finpac+13-14+zoll+laptoptasche&qid=1667234996&sprefix=%2Caps%2C84&sr=8-3', '31,99', 4.7, 44, 0, '-;-;【Größe】Maximal passende Modellgröße: 33.63 x 23.80 x 3.50 cm. Kompatibel mit Macbook Pro 14 Zoll A2442 (2021), 13,6" Macbook Air M2 A2681 2022, 13,3" MacBook Air M1, 13,3" MacBook Pro M2 M1 A2338, iPad Pro 12,9", 13.5" Microsoft Surface Laptop 4/3/2/1, 13.5" Surface Book 3/2/1, Surface Pro X/8/7/6/5/4/3, 12.4" Surface Laptop Go, Dell XPS 13, 13,3" LincPlus P1 Laptop, für 13,3" Jumper Laptop, 13" Acer Chromebook und andere Dell/ Asus/ Acer/ Toshiba/ Lenovo Notebook/ Ultrabook/ Laptop bis 13 Zoll.|【Haltbarkeit】Wasserabweisende, verschleißfeste Oberfläche mit stoßfestem Innenmaterial schützt Ihr Gerät vor Staub, Schlägen, Stößen, Kratzern, Schrammen und Flüssigkeiten.|【Multifunktional】Zwei große Fächer im Hauptfach bieten ausreichend Platz für Ihren Laptop und ein größeres Tablet. Das in die Vorderseite integrierte Zubehörfach bietet bequem Platz für kleine persönliche Gegenstände wie kleine Tablets, Mobiltelefone, Mouse, Kabel, Ladegeräte, Powerbanks, Stifte und anderes Zubehör.|【Überragender Schutz】Die Hartschale besteht aus EVA - schützt Ihr Gerät hervorrangend vor Stößen und Kratzern.|【Flexibel zum Tragen】Der abnehmbare Schultergurt bietet einen flexibleren Tragekomfort. Der glatte und langlebige Reißverschluss ermöglicht einen einfachen Zugang und erhöht die Sicherheit.');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/MacBook-Tasche/NEWHEY Laptop-Tasche.webp;', 'NEWHEY Laptop-Tasche', 'https://www.amazon.de/NEWHEY-Laptoptasche-Laptoph%C3%BClle-Kompatibel-wasserdichte/dp/B08YR45SPW/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1U5MYBRHZL6UD&keywords=NEWHEY+Laptop-Tasche&qid=1667235001&sprefix=%2Caps%2C67&sr=8-3', '18,99', 4.3, 619, 0, 'grey;NEWHEY;【ANWENDBARE GRÖSSE】 Die Laptop-Hülle kompatibel mit 13 "-14" Laptop / Tablet / Notebook / Ultrabook; Außenmaße(L x B x H): 14,96 "x 10,82" x 1,18 ", Innenmaße(L x B x H): 14,17" x 10,2 "x 0,98". (Bitte erlauben Sie aufgrund der manuellen Messung eine etwas andere Größe).|【Dreischichtiger Schutz】Die hochwertige Laptop tasche besteht aus hochwertigem, weichem, wasserdichtem Leder, einem stoßfesten Schwamm und inneren Schaumstoffkissen und bietet Ihrem Laptop einen 360 °-Schutz gegen unerwünschte Kratzer und Stöße. Mit seiner spritzwassergeschützten Oberfläche ist die macbook air tasche leicht zu reinigen.|【Praktisches Aufbewahrungsdesign】NEWHEY-Notebook tasche hat eine Haupttasche für Ihr Laptop. Eine vordere Reißverschlusstasche bietet Platz für ein iPad mini, ein Smartphone usw. In der Macbook Pro-Hülle mit extra kleiner Tasche können Sie Ihr Netzteil, USB-Kabel, Maus, Ladegeräte, Powerbanks, AirPods, Kopfhörer und mehr aufbewahren.|【Leicht &amp; Tragbar】Diese Computer taschen sleeve kann problemlos in Ihre Aktentasche, Ihren Rucksack oder andere Gepäcktaschen gesteckt werden, was sie für den täglichen Gebrauch, Geschäftsreisen, die Schule und das Reisen überall so bequem macht.|【Perfekte Geschenke】Muti-Styles &amp; Multi-Color-Optionen; Diese modische Laptop Schutzhülle ist die perfekte Geschenkwahl für: Geburtstagsgeschenk für Freunde, Weihnachtsgeschenk, Erntedankgeschenk, Neujahrsgeschenk usw.');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/MacBook-Tasche/MOSISO Laptop Hülle.webp;', 'MOSISO Laptop Hülle', 'https://www.amazon.de/MOSISO-Wasserresistente-Laptoph%C3%BClle-Laptoptasche-Notebooktasche/dp/B01AD15EXI/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3RFT0O26OSD6O&keywords=mosiso+laptoph%C3%BClle&qid=1667235007&qu=eyJxc2MiOiI0LjcwIiwicXNhIjoiMy45NyIsInFzcCI6IjIuOTgifQ%3D%3D&sprefix=%2Caps%2C66&sr=8-4', '23,99', 4.5, 518, 0, 'black;MOSISO;Innenmaße: 15,35 x 0,79 x 11,02 zoll / 38,9 x 2 x 28 cm (L x B x H); Außenmaße: 15,94 x 0,79 x 11,42 zoll / 40,5 x 2 x 29 cm (L x B x H). Der zusätzliche kleine Tasche Tasche Innenmaß ist: 5,71 x 0,59 x 5,12 Zoll / 14,5 x 1,5 x 13 cm (L x B x H); Außenmaß ist: 6,3 x 0,59 x 5,31 Zoll / 16 x 1,5 x 13,48 cm (L x B x H). MOSISO 1 Jahr Garantie auf jede Tasche.|Verfügt über eine Polsterschicht aus Neoprenschaum und ein flauschiges Fleece-Stofffutter zur Stoß- und Stoßdämpfung und zum Schutz Ihres Computers vor versehentlichen Kratzern.|Zusätzliche kleine Aufbewahrungstasche für die Aufbewahrung von Laptop-Maus und Kopfhörer. Gleiche Farbe wie die große Ärmeltasche, harmonisch und stilvoll. Diese Schutzhülle case cover Tasche mit kleiner Tasche ist ideal, um Ihren Laptop mitzunehmen.|Schlank und leicht; Schüttet nicht Ihr notebook oben und kann leicht in Ihre Aktenkoffer, Rucksack oder andere Tasche verschieben. Top-loading Reißverschluss auf der Tasche gleitet sanft und ermöglicht einen bequemen Zugriff auf Ihr notebook.|Kompatibel mit MacBook Pro 16 Zoll 2022 2021 A2485 M1 Pro/M1 Max mit Touch ID, kompatibel mit MacBook Pro 16 A2141 2019 2020, kompatibel mit MacBook Pro Retina 15,4 A1398; Kompatibel mit Surface Book 3/2/1 15; Kompatibel mit Asus ZenBook/VivoBook 15; Kompatibel mit Acer Swift 3 14 / Swift 5 15,6, kompatibel mit Acer Aspire 3/5/7 15,6; Kompatibel mit HP ProBook/Spectre x360/Envy x360 15,6; kompatibel mit HP Omen/Pavilion x360 15,6; Kompatibel mit Dell XPS/Precision/Vostro/Latitude 15.');
