oBook 15; Kompatibel mit Acer Swift 3 14 / Swift 5 15,6, kompatibel mit Acer Aspire 3/5/7 15,6; Kompatibel mit HP ProBook/Spectre x360/Envy x360 15,6; kompatibel mit HP Omen/Pavilion x360 15,6; Kompatibel mit Dell XPS/Precision/Vostro/Latitude 15.');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/MacBook-Tasche/LANDICI Laptop-Tasche.webp;', 'LANDICI Laptop-Tasche', 'https://www.amazon.de/LANDICI-Laptoptasche-wasserdichte-Notebooktasche-Griff-Schwarz/dp/B09DFC1YLC/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=29QYY242GZ0WC&keywords=LANDICI+Laptop-Tasche&qid=1667235020&sprefix=l%2Caps%2C122&sr=8-3', '18,99', 4.7, 228, 0, 'black;LANDICI;【Größe】Interne Größe 34.5 × 24.8 × 2 cm (13.6 x 9.8 x 0.8 Zoll), kompatibel mit 13" MacBook Air | 13" MacBook Pro | 12.3" Surface Pro | 13.5" Microsoft Surface Book 1 2 3 2020 | 13.5" Surface Laptop 4/3 | 12.9" iPad Pro usw.|【Stoßfest und Wasserabweisend】Mehrlagige Verpackungsmaterialien können das Risiko eines versehentlichen Sturzes effektiv reduzieren. Die wasserdichte Außenschicht kann Wasser effektiv isolieren, Spritzwasser verhindern, das Innere trocken halten und den Computer schützen.|【Weiches Innenfutter und kratzfeste Außenschicht】Das Innere besteht aus bequemem Plüschstoff, die kratzfeste Außenschicht verhindert Kratzer, hochwertiger Reißverschluss, bequem für Sie, um den Computer schnell ein- und auszunehmen und Ihren Computer zu schützen.|【Praktische doppellagige Taschen und Griffe】Wir haben der Laptoptasche zwei Seitentaschen hinzugefügt, von denen eine zur Aufbewahrung von Computerzubehör oder Zeitschriftenartikeln und die andere zum Aufbewahren von Mobiltelefonen, Bluetooth-Headsets und anderen Gegenständen verwendet werden kann. Praktischer Griff, bequem zur Arbeit oder Schule zu gehen.|【After-Sales-Garantie】Wir hoffen aufrichtig, dass Sie die Größe Ihres Computers vor der Bestellung der Ware ermitteln, damit Sie problemlos eine geeignete laptophülle kaufen können. Bei Fragen können Sie uns jederzeit per E-Mail kontaktieren, Ich wünsche Ihnen ein glückliches Einkaufen!');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (11, '../img/products/MacBook-Tasche/TECOOL 13-13.3 Zoll Laptoptasche.webp;', 'TECOOL 13-13.3 Zoll Laptoptasche', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo2MjAwMDE4MzgxMTg3NTM1OjE2NjcyMzUwMzI6c3BfYXRmOjIwMDczNzg2NTIyMzk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FTECOOL-Notebooktasche-Schutzh%25C3%25BClle-2010-2017-Dunkelgrau%2Fdp%2FB084RQ8MJG%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D3KPLK86JN5EF6%26keywords%3DTECOOL%2B13-13.3%2BZoll%2BLaptoptasche%26qid%3D1667235032%26sprefix%3Dtecool%2B13-13.3%252Caps%252C88%26sr%3D8-2-spons%26psc%3D1', '16,99', 4.6, 6497, 0, 'grey;TECOOL;Kompatibel: Die 13,3 Zoll Laptoptasche ist kompatibel mit 2010-2017 MacBook Air 13 (A1369/A1466), 2012-2015 MacBook Pro 13 Retina (A1425/A1502), 13,3'' ASUS Zenbook Flip 13, 13,5'' Surface Laptop 4/3, 2021 MacBook Pro 14, und 13,3'' Acer ASUS Lenovo Dell HP Notebook Chromebook.|Innenmaße: 33 x 23 x 2,0 cm (13 x 9 x 0,8 Zoll), Die Notebook Tasche passt für 13,9-14 Zoll Ultrabook kompatibel, wie 14'' Lenovo Yoga Slim7, 13,9'' Lenovo Yoga C930, Lenovo Thinkbook 14, 14'' Acer Swift 1/3/5/7 ultradünner Laptop, Huawei Matebook 14, ASUS Zenbook/Vivobook 14. Bitte überprüfen Sie die Abmessungen Ihres Laptops, bevor Sie die Tragetasche bestellen.|Überlegener Schut: Die Außenschicht der Laptophülle besteht aus wasserdicht Polyestergewebe. 1mm EVA + 8 mm Stoßfeste Schaumstoffpolsterung und weiches, bequemes, samtartiges Futter bilden zwei innere Schichten der Tasche. Öffnung auf der rechten Seite. Kanten und Ecken der notebooktasche (außer der Reißverschlussseite) sind mit stoßfestem Schaumstoff gepolstert.|Vordertaschen: Ein Hauptfach bietet guten Schutz für Ihren Laptop. Die Laptophülle hat zwei Fronttaschen. Eine Reißverschlusstasche bietet Platz für Zubehör, Maus, Ladeadapter und Smartphone. Und eine andere dient zur Aufbewahrung von Stiften, Karten oder anderen kleinen Gegenständen.|Robuster Reißverschluss und einziehbarer Griff: Alle Taschen der 13,3 zoll laptop sleeve sind mit einem glatten, haltbaren Metallreißverschluss verschlossen. Mit dem bequemen versenkbaren Griff kann die leichte Tragetasche problemlos in Rucksack und Koffer gesteckt werden.');
INSERT INTO `macbook-tasche` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (12, '../img/products/MacBook-Tasche/JETech Tasche für 13,3 Zoll.webp;', 'JETech Tasche für 13,3 Zoll', 'https://www.amazon.de/JETech-Laptoph%C3%BClle-Schutzh%C3%BClle-Schock-best%C3%A4ndiger-Zubeh%C3%B6rtasche/dp/B076ZQQTYR/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=30NGMDVV1QEK3&keywords=JETech+Tasche+f%C3%BCr+13%2C3+Zoll&qid=1667235040&sprefix=%2Caps%2C145&sr=8-3', '15,99', 4.7, 26796, 0, 'grey;JETech;Entwickelt für MacBook Pro 14 Zoll 2021 und Laptops/Tablets bis zu 13,3 Zoll, einschließlich 13 Zoll MacBook Pro Ende 2012–2015 und MacBook Air, 12,3 Zoll Surface Pro 3/4/5/6, Surface Laptop 2017/2018, 13 Zoll MacBook Pro 2016 / 2017 / 2018 / 2020 (A1706 / A1708 / A1989 / A2156), 13'' MacBook Air 2018/2020, 14-Zoll MacBook Pro 2021 M1, 13-13,6 Zoll Notebook|Die robuste Hülle verfügt über Schaumstoffpolster, die Ihr Tablette/Laptop vor Staub, Kratzern, Stürzen und Stößen schützen|Eine zusätzliche Fronttasche kann Gegenstände wie Stifte, Handytelefone, Kabel, Ladegeräte, Powerbanks und mehr enthalten|Das spritzwassergeschützte Äußere ist leicht zu reinigen und hält die Hülse über einen langen Zeitraum in einem makellosen Zustand|Außenabmessungen: 34,3 x 25,4 x 3,3 cm, Innenabmessungen: 32,5 x 23,6 x 2 cm. kundendienstkarte von JETech');
